/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	tabindex="${ifDefined(context._tabIndex)}"	@click="${context._select}"	@keydown="${context._keydown}"	class="ui5-token--wrapper"	dir="${ifDefined(context.dir)}"	role="option"	aria-selected="${ifDefined(context.selected)}"><span class="ui5-token--text"><slot></slot></span>	${ !context.readonly ? block1(context) : undefined }</div>`; };
const block1 = (context) => { return html`<ui5-icon			@click="${context._delete}"			name="${ifDefined(context.iconURI)}"			accessible-name="${ifDefined(context.tokenDeletableText)}"			show-tooltip			class="ui5-token--icon"		></ui5-icon>	`; };

export default block0;
